@import url("https://unpkg.com/@primo-app/primo@1.3.64/reset.css");

:root {
  /* Fonts  */
  --font-heading: 'Fraunces', serif;
  --font-body: 'IBM Plex Mono', monospace;
  --font-text: 'Work Sans', sans-serif;

  /* Colors */
  --color-Y500: #E9D90A;
  --color-Y400: #F6E500;
  --color-Y300: #F7D254;
  --color-Y200: #FFF587;
  --color-Y100: #FFFCDA;

  --color-P500: #E82884;
  --color-P400: #FF4FA3;
  --color-P300: #FF74B7;
  --color-P200: #FFB1D7;
  --color-P100: #FFD6E9;

  --color-T500: #50ADBE;
  --color-T400: #69C9DB;
  --color-T300: #A8E1EC;
  --color-T200: #C2F1FA;
  --color-T100: #E2FAFF;

  --color-G500: #C8C9DC;
  --color-G400: #D5D7EF;
  --color-G300: #E6E7FB;
  --color-G200: #EEF2FD;
  --color-G100: #F4F9FC;

  --color-black: #000000;
  --color-white: #FFFFFF;

  /* Base values */
  --color-primary: var(--color-Y400);
  --color-secondary: var(--color-P400);
  --color-tertiary: var(--color-black);
  --color-tertiary: var(--color-white);

  /* --color: var(--color-base);
  --box-shadow: 0px 4px 30px rgba(0, 0, 0, 0.2);
  --border-radius: 8px;
  --border-color: #eee;
  --background: white; */
  --border: 0.851905px solid var(--color-black);
  --border-radius: 4.25952px;
  --max-content-width-mobile: 768px;
  --max-content-width-small-desktop: 900px;
  --max-content-width: 1200px;
  --page-padding-desktop: 90px 80px;
  --page-padding-small-desktop: 120px 60px;
  --page-padding-mobile: 90px 18px;

  --hero-padding-desktop: 150px 80px 90px 80px;
  --hero-padding-large-desktop: 200px 80px 90px 80px;

  --hero-padding-mobile: 100px 18px 90px 18px;
  --content-padding: 0px 50px;

}


#page {
  a {
    color: var(--color-black);
  }
  h1,h2,h3,h4 {
    font-family: var(--font-heading);
    font-weight: 700;
    color: var(--color-black);
  }

  h1 {
    font-size: 33px;
    line-height: 39px;
    @media only screen and (min-width: 1024px) {
      font-size:  67px;
      line-height: 69px;
    }
    @media only screen and (min-width: 1440px) {
      font-size:  83px;
      line-height: 93px;
    }
  }

  h2 {
    font-size: 28px;
    line-height: 33px;
    @media only screen and (min-width: 1024px) {
      font-size:  55px;
      line-height: 65px;
    }
    @media only screen and (min-width: 1440px) {
      font-size:  65px;
      line-height: 75px;
    }
  }

  h3 {
    font-size: 28px;
    line-height: 33px;
    @media only screen and (min-width: 1024px) {
      font-size:  45px;
      line-height: 57px;
    }
    @media only screen and (min-width: 1440px) {
      font-size:  55px;
      line-height: 68px;
    }
  }

  h4 {
    font-size: 26px;
    line-height: 34px;
    @media only screen and (min-width: 1024px) {
      font-size:  37px;
      line-height: 50px;
    }
    @media only screen and (min-width: 1440px) {
      font-size:  45px;
      line-height: 58px;
    }
  }

  h5, h6, .h650, .h700, .h800, .h900, .h950 {
    font-family: var(--font-body);
    color: var(--color-black);
  }


  h5 {
    font-weight: 700;
    font-size: 20px;
    line-height: 28px;
    @media only screen and (min-width: 1024px) {
      font-size:  30px;
      line-height: 39px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  30px;
      line-height: 39px;
    }
  }

  h6 {
    font-weight: 700;
    font-size: 18px;
    line-height: 26px;
    @media only screen and (min-width: 1024px) {
      font-size:  21px;
      line-height: 29px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  25px;
      line-height: 33px;
    }
  }

  .h650 {
    font-weight: 500;
    font-size: 18px;
    line-height: 26px;
     @media only screen and (min-width: 1024px) {
      font-size:  21px;
      line-height: 29px;
    }   
    @media only screen and (min-width: 1440px) {
      font-size:  25px;
      line-height: 33px;
    }
  }

  .h700 {
    font-weight: 700;
    font-size: 16px;
    line-height: 20px;
    @media only screen and (min-width: 1024px) {
      font-size:  16px;
      line-height: 20px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  18px;
      line-height: 25px;
    }
  }

  .h800 {
    font-weight: 500;
    font-size: 12px;
    line-height: 16px;
    @media only screen and (min-width: 1024px) {
      font-size:  12px;
      line-height: 16px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  17px;
      line-height: 22px;
    }
  }

  .h900 {
    font-weight: 700;
    font-size: 14px;
    line-height: 20px;
    @media only screen and (min-width: 1024px) {
      font-size:  14px;
      line-height: 20px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  16px;
      line-height: 22px;
    }
  }

  .h950 {
    font-weight: 500;
    font-size: 14px;
    line-height: 20px;
    @media only screen and (min-width: 1024px) {
      font-size:  14px;
      line-height: 20px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  16px;
      line-height: 22px;
    }
  }

  p {
    font-family: var(--font-text);
    font-weight: 400;
    color: var(--color-black);
  }

  .p-large {
    font-size: 17px;
    line-height: 26px;
    @media only screen and (min-width: 1024px) {
      font-size:  18px;
      line-height: 28px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  20px;
      line-height: 31px;
    }
  }

  .p-medium {
    font-size: 15px;
    line-height: 22px;
    @media only screen and (min-width: 1024px) {
      font-size:  15px;
      line-height: 22px;
    }    
    @media only screen and (min-width: 1440px) {
      font-size:  17px;
      line-height: 25px;
    }
  }

  .p-small {
    font-size: 13px;
    line-height: 18px;
    @media only screen and (min-width: 1024px) {
      font-size:  15px;
      line-height: 22px;
    }   
    @media only screen and (min-width: 1440px) {
      font-size:  14px;
      line-height: 18px;
    }
  }

  .link {
    color: var(--color-P500);
    text-decoration-line: underline;
    &:hover {
      text-decoration-line: unset;
    }
    &:active {
      color: var(--color-P300);
    }
    &:visited {
      color: var(--color-P500);
      text-decoration-line: underline;
    }
  }

  .tag-pink-large,
  .tag-yellow-large,
  .tag-lightyellow-large {
    border-width: 2px;
    border: var(--border);
    border-radius: var(--border-radius);
    padding: 0px 12.7786px;
    gap: 8.52px;
    height: 34.52px;
    width: max-content;
    display: flex;
    align-items: center;

    @media only screen and (min-width: 1440px) {
      height: 41.52px;
    }
  }

  .tag-pink-small,
  .tag-yellow-small,
  .tag-lightyellow-small {
    border-width: 2px;
    border: var(--border);
    border-radius: var(--border-radius);
    padding: 0px 10px;
    gap: 8.52px;
    height: 32px;
    width: max-content;
    display: flex;
    align-items: center;

    @media only screen and (min-width: 1440px) {
      height: 37px;
    }
  }

  .tag-pink-large {
    background-color: var(--color-secondary);
  }

  .tag-pink-small {
    background-color: var(--color-secondary);
  }

  .tag-yellow-large {
    background-color: var(--color-primary);
  }

  .tag-yellow-small {
    background-color: var(--color-primary);
  }

  .tag-lightyellow-large {
    background-color: var(--color-Y100);
  }

  .tag-lightyellow-small {
    background-color: var(--color-Y100);
  }


  .primary-large-button {
    font-family: var(--font-body);
    color: var(--color-black);
    border-radius: 100px;
    /* height: 60px; */
    background-color: var(--color-black);
    color: var(--color-white);
    padding: 20px 35px;
    font-weight: 700;
    font-size: 16px;
    line-height: 23px;
    border: 2px solid var(--color-black);
    transition: all 0.5s;
    @media only screen and (min-width: 1440px) {
      padding: 25px 40px;
      font-weight: 700;
      font-size: 18px;
      line-height: 25px;
    }
    &:hover {
      background: transparent;
      color: var(--color-black);
      border: 2px solid var(--color-black);
    }
    &:active {
      margin: -1px;
      border: 3px solid var(--color-black);
    }
  }

  .primary-small-button {
    font-family: var(--font-body);
    color: var(--color-black);
    border-radius: 100px;
    /* height: 40px; */
    background-color: var(--color-black);
    color: var(--color-white);
    padding: 10px 25px;
    font-weight: 700;
    font-size: 14px;
    line-height: 20px;
    transition: all 0.5s;
    border: 2px solid var(--color-black);
    @media only screen and (min-width: 1440px) {
      padding: 15px 40px;
      font-weight: 700;
      font-size: 16px;
      line-height: 22px;
    }
    &:hover {
      background: transparent;
      color: var(--color-black);
      border: 2px solid var(--color-black);
    }
    &:active {
      margin: -1px;
      border: 3px solid var(--color-black);
    }
  }

  .secondary-button {
    font-family: var(--font-body); 
    color: var(--color-black);
    border-radius: 100px;
    height: 52px;
    border: 3px solid var(--color-black);
    color: var(--color-black);
    transition: all 0.5s;
    padding: 15px 34px;
    font-weight: 700;
    font-size: 14px;
    line-height: 22px;
    background: transparent;

    &:hover {
      background: var(--color-black);
      color: var(--color-white);
    }
    &:active {
      background: var(--color-G500);
      border-color: var(--color-G500);
    }
  }
}

