.lottie {
  height: 300px;
  width: 300px;
  @media (min-width: 1440px) {
    height: 500px;
    width: 500px;
  }
}

.section-container {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items:center;
}

.content-image {
  width: 200px;

  @media (min-width: 1440px) {
    width: 250px;
  }
}


.container {
  padding: var(--page-padding-mobile);
  padding-top: 90px;
  padding-bottom: 0px;
  width: 100%;
  background-color: var(--color-white);

  @media (min-width: 768px) {
    padding: var(--page-padding-desktop);
    padding-top: 90px;
    padding-bottom: 0px;
  }
  @media (min-width: 1440px) {
    padding: 0px;  
    padding-top: 140px;
    padding-bottom: 0px;
    margin: auto;

  }
}


.wrapper {
  @media (min-width: 768px) {
	margin: auto;
    max-width: var( --max-content-width-mobile);
    padding: var(--page-padding-desktop);
    padding-top: 0;
    padding-bottom: 0;
  }
  @media (min-width: 1024px) {
    max-width: var(--max-content-width-small-desktop);
    padding-left: 0;
    padding-right: 0;
  }

  @media (min-width: 1440px) {
    padding-left: 0px;  
    padding-right: 0px;
    /* max-width: var(--max-content-width); */
    max-width: 830px;
    width: 100%;
    margin: auto;
  }
}

